import * as THREE from '../../../../../../text/javascript/threejs/build/three.module.js';

function setupEnvironment () {
    this.renderer = new THREE.WebGLRenderer({
        antialias: true,
        alpha: false
    });
    this.renderer.setSize(window.innerWidth, window.innerHeight);
    this.renderer.setClearColor(0x000000, 0);
    this.renderer.domElement.id = "canvas";
    this.renderer.context.getProgramInfoLog = function () { return '' }; // muzzle
    document.body.appendChild(this.renderer.domElement);
    this.camera = new THREE.PerspectiveCamera(50, window.innerWidth / window.innerHeight, 1, 1000);
    this.camera.position.set(0, 0, 50);
    this.scene = new THREE.Scene();
    this.container = new THREE.Object3D();
    this.scene.add(this.container);
    var scene = this.scene;
    var particleCount = 100;

    var uniforms = { textures: { type: 'tv', value: this.getTextures() } };
    var attributes = { texIndex: { type: 'f', value: [] }, color: { type: 'c', value: [] }, };
    var material = new THREE.ShaderMaterial({
        uniforms: uniforms,
        attributes: attributes,
        vertexShader: this.getVertexShader(),
        fragmentShader: this.getFragmentShader(uniforms.textures.value.length),
        transparent: true
    });

    var geometry = new THREE.Geometry();
    for (var i = 0; i < particleCount; i++) {
        geometry.vertices.push(new THREE.Vector3( (Math.random() - 0.5) * 50, (Math.random() - 0.5) * 50, (Math.random() - 0.5) * 50));
        attributes.texIndex.value.push(Math.random() * uniforms.textures.value.length  | 0);
        attributes.color.value.push(new THREE.Color(0xffffff));
    }
    var particles = new THREE.PointCloud(geometry, material);
    particles.sortParticles = true;
    this.container.add(particles);
};

function render  () {
    this.container.rotation.y += 0.001;
    this.renderer.render(this.scene, this.camera);
};

function resize  () {
    this.renderer.setSize(window.innerWidth, window.innerHeight);
    this.camera.aspect = window.innerWidth / window.innerHeight;
    this.camera.updateProjectionMatrix();
};

function getVertexShader(){
    let vertexShader = `
        attribute vec3 color;
        attribute float texIndex;
        varying vec3 vColor;
        varying float vTexIndex;
        void main() {
            vec4 mvPosition = modelViewMatrix * vec4(position, 1.0);
            vColor = color;
            vTexIndex = texIndex;
            gl_PointSize = 50.0;
            gl_Position = projectionMatrix * mvPosition;
        }`;
        return vertexShader;
}

export function getFragmentShader(numTextures){
	var fragShader =  `
    uniform sampler2D textures[${numTextures}];
    varying vec3 vColor;
    varying float vTexIndex;
    void main() {
        vec4 startColor = vec4(vColor, 1.0);
        vec4 finalColor;
		`;
      for(var i = 0; i < numTextures; i++){
        if(i == 0){ 
          fragShader += `if (vTexIndex < ${i}.5) {
            finalColor = texture2D(textures[${i}], gl_PointCoord);
            }
          `
        }
        else{
          fragShader += `else if (vTexIndex < ${i}.5) {
            finalColor = texture2D(textures[${i}], gl_PointCoord);
            }
          `
        }
      }
    fragShader += `gl_FragColor = startColor * finalColor;
    }`;   
    console.log('frag shader: ', fragShader)
    return fragShader;
}

export function getTextures () {
THREE.ImageUtils.crossOrigin = '';
    return [
THREE.ImageUtils.loadTexture('data:image/jpeg;base64,'),
THREE.ImageUtils.loadTexture('data:image/png;base64,'),
THREE.ImageUtils.loadTexture('data:image/png;base64,'),
THREE.ImageUtils.loadTexture('data:image/jpeg;base64,'),
THREE.ImageUtils.loadTexture('data:image/jpeg;base64,'),
THREE.ImageUtils.loadTexture('data:image/png;base64,')
];
};
